
delimiter $$

-- 회원 테이블
drop table if exists `tcare_user` cascade $$

create table `tcare_user`
(
    `uid` bigint not null                           comment '일련번호 base (use nauth)',
    `userType` tinyint default 9                    comment '사용자 타입',
    `username` varchar(128) not null                comment '사용자 ID',
    `password` varchar(256) not null                comment '비밀번호 HmacSHA256',
    `provider` varchar(32) not null                 comment '정보제공자',
    `joinedAt` bigint default 0                     comment '가입일자',
    `leftAt` bigint default 0                       comment '탈퇴일자',
    `email` varchar(256) null                       comment '이메일 주소',
    `accountLocked` tinyint default 0               comment '계정 잠금(휴먼 등)',
    `accountName` varchar(64) not null              comment '사용자 이름',
    `profileUrl` varchar(512) default ''            comment '프로필 주소',
    `phoneNumber` varchar(32) null                  comment '핸드폰 번호',
    `privacyTermsReadAt` bigint default 0           comment '개인정보취급방침동의',
    `serviceTermsReadAt` bigint default 0           comment '서비스약관동의',
    `pushToken` varchar(512) null                   comment '푸시토큰',
    `usePush` tinyint default 1                     comment '푸시 사용',
    `tempPassword` varchar(256)                     comment '임시 비번',
    `tempPasswordExpire` bigint default 0           comment '임시 비번 만료',
    `deviceOsType` varchar(32)                      comment '디바이스 종류',
    constraint pk_tcare_user primary key (`uid`)
) $$


                      privacyTermsReadAt, serviceTermsReadAt, pushToken, usePush)
