drop table if exists `tcare_auth_provider` cascade $$ 

create table tcare_auth_provider
(
    seq             bigint auto_increment comment '일련번호'
        primary key,
    authUid         bigint      default 0           null comment '소유자 일련번호',
    provider        varchar(16) default 'neoulsoft' null comment '인증정보 제공자 (neoulsoft, kakao, naver)',
    providerPayload text                            null comment '인증정보 제공자 결과',
    authorizedAt    bigint      default 0           null comment '인증일자',
    providerId      varchar(128)                    not null comment '인증정보 제공자 식별값',
    recentlyUsed    tinyint     default 0           null comment '마지막 인증 사용'
) $$

values (10106333, 'neoulsoft', '{}', unix_timestamp() * 1000, 'admin', 1) $$


drop table if exists `tcare_files` cascade $$

create table tcare_files
(
    seq          bigint auto_increment comment '파일 일련번호'
        primary key,
    fileOwnerUid bigint default 0 null comment '파일 소유자.',
    fileName     varchar(256)     not null comment '파일이름 (확장자 포함)',
    fileExt      varchar(64)      null comment '파일 확장자',
    fileSize     bigint default 0 null comment '파일 크기',
    mimeType     varchar(128)     not null comment '마임타입',
    fileUrl      varchar(512)     not null comment '파일 경로',
    originUrl    varchar(512)     null comment '파일 원본 url',
    refSeq       bigint default 0 null comment '리뷰번호,',
    refSubSeq    bigint default 0 null comment '리뷰댓글번호,',
    registeredAt bigint default 0 null comment '등록일자'
) $$

drop table if exists `tcare_menu` cascade $$

create table tcare_menu
(
    seq       bigint auto_increment comment '일련번호'
        primary key,
    parentSeq bigint       default 0  null comment '상위 일련번호',
    menuName  varchar(32)             not null comment '메뉴이름',
    menuIcon  varchar(64)             not null comment '메뉴아이콘',
    iconSize  tinyint      default 24 null comment '아이콘 크기',
    menuLevel tinyint      default 3  null comment '메뉴 노출 권한',
    menuPath  varchar(256) default '' null comment '메뉴 경로',
    menuOrder tinyint      default 0  null comment '메뉴 순서'
) $$

delimiter $$

drop table if exists `tcare_agency` cascade $$

create table tcare_agency (
    region varchar(128),
    teamName varchar(128),
    hqCode varchar(6),
    agencyName varchar(128),
    agencyCode varchar(16) not null,
    storeName varchar(128),
    address varchar(512),
    createdAt varchar(10),
    openedAt varchar(10),
    storeType varchar(32),
    fundType varchar(32),
    area varchar(32),
    agencyStatus varchar(64),
    serviceStatus varchar(64),
    agencyRepName varchar(64),
    agencyPhone varchar(16),
    agencyOpt1 varchar(128),
    agencyOpt2 varchar(128),
    constraint pk_tcare_agency primary key(agencyCode)
) $$


